import React from "react";
import Logo from './logo.svg';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

import './style.css';

export default function Header() {
    return (
        <>
            <ul>
                <li className="d-flex logo">
                    <img src={Logo} style={{
                        marginRight: "10px",
                    }} />
                    <h2>Gyber.org</h2>
                </li>
                <li>
                    <ul className="d-flex space-between list">
                        <li>Home</li>
                        <li>Philosophy</li>
                        <li>Lite Paper</li>
                    </ul>
                </li>
                <li>
                    <button className="rgbBtn">Private sale</button>
                </li>
            </ul>
        </>
    );
}
